import React from 'react';

import ProjectInfo from './projectInfo';

function MyProjects(props){

    const loadProjects = () => {
        let myProjects = [];

        for(let i = 0; i < 20; i++){
            myProjects.push(<ProjectInfo />);
        }

        if(myProjects.length > 9){
            document.getElementById("div1").style.overflow = "auto";
            // document.querySelector(".divMyProjects").style.overflow = "auto";
        }
        return myProjects;
    }

    return(
        <div className="divMyProjects" id="div1">
            <h2>Meus Projetos</h2>
            <div className="myProjectsGrid">
                {loadProjects()}
            </div>
        </div>
    )
}

export default MyProjects;
